import React,{useState} from "react";
import {
  Container, 
  Box, 
  FormControl, 
  InputLabel, 
  Select, 
  MenuItem, 
  Button, 
  Table, 
  TableBody, 
  TableCell, 
  TableContainer, 
  TableHead, 
  TableRow, 
  Pagination
} from '@mui/material';

const Venue = () => {
    const [timeZone, setTimeZone] = useState('');
  const [state, setState] = useState('');
  const [instructor, setInstructor] = useState('');
  const [venues, setVenues] = useState([]);
  const [currentPage, setCurrentPage] = useState(1);
  const [itemsPerPage] = useState(3);

  const handleSearch = () => {
    // 模拟一个搜索功能
    setVenues([
      { id: 1, title: 'Venue 1', timeZone: 'Time Zone 1', state: 'State 1', instructor: 'Instructor 1', date: '2023-09-05' },
      { id: 2, title: 'Venue 2', timeZone: 'Time Zone 2', state: 'State 2', instructor: 'Instructor 2', date: '2023-09-05' },
      { id: 3, title: 'Venue 3', timeZone: 'Time Zone 3', state: 'State 3', instructor: 'Instructor 3', date: '2023-09-05' },
      { id: 4, title: 'Venue 4', timeZone: 'Time Zone 4', state: 'State 4', instructor: 'Instructor 4', date: '2023-09-05' },
    ]);
  };

  const handleReset = () => {
    setTimeZone('');
    setState('');
    setInstructor('');
    setVenues([]);
    setCurrentPage(1);
  };

  // 分页逻辑
  const indexOfLastItem = currentPage * itemsPerPage;
  const indexOfFirstItem = indexOfLastItem - itemsPerPage;
  const currentItems = venues.slice(indexOfFirstItem, indexOfLastItem);
  const totalPages = Math.ceil(venues.length / itemsPerPage);

  return (
    <Container>
      <Box display="flex" alignItems="center" mb={3}>
        <FormControl variant="outlined" sx={{ minWidth: 200, mr: 2 }}>
          <InputLabel>Time Zone</InputLabel>
          <Select
            value={timeZone}
            onChange={(e) => setTimeZone(e.target.value)}
            label="Time Zone"
          >
            <MenuItem value=""><em>请选择</em></MenuItem>
            <MenuItem value="时区 1">时区 1</MenuItem>
            <MenuItem value="时区 2">时区 2</MenuItem>
            <MenuItem value="时区 3">时区 3</MenuItem>
          </Select>
        </FormControl>
        <FormControl variant="outlined" sx={{ minWidth: 200, mr: 2 }}>
          <InputLabel>State</InputLabel>
          <Select
            value={state}
            onChange={(e) => setState(e.target.value)}
            label="State"
          >
            <MenuItem value=""><em>请选择</em></MenuItem>
            <MenuItem value="州 1">州 1</MenuItem>
            <MenuItem value="州 2">州 2</MenuItem>
            <MenuItem value="州 3">州 3</MenuItem>
          </Select>
        </FormControl>
        <FormControl variant="outlined" sx={{ minWidth: 200, mr: 2 }}>
          <InputLabel>Instructor</InputLabel>
          <Select
            value={instructor}
            onChange={(e) => setInstructor(e.target.value)}
            label="讲师"
          >
            <MenuItem value=""><em>请选择</em></MenuItem>
            <MenuItem value="讲师 1">讲师 1</MenuItem>
            <MenuItem value="讲师 2">讲师 2</MenuItem>
            <MenuItem value="讲师 3">讲师 3</MenuItem>
          </Select>
        </FormControl>
        <Button variant="contained" color="primary" onClick={handleSearch} sx={{ mr: 2 }}>
          Search
        </Button>
        <Button variant="outlined" onClick={handleReset}>
          Reset
        </Button>
      </Box>
      <TableContainer>
        <Table>
          <TableHead>
            <TableRow>
              <TableCell>Id</TableCell>
              <TableCell>VenueName</TableCell>
              <TableCell>TimeZone</TableCell>
              <TableCell>State</TableCell>
              <TableCell>Instructor</TableCell>
              <TableCell>City</TableCell>
            </TableRow>
          </TableHead>
          <TableBody>
            {currentItems.map((venue) => (
              <TableRow key={venue.id}>
                <TableCell>{venue.id}</TableCell>
                <TableCell>{venue.title}</TableCell>
                <TableCell>{venue.timeZone}</TableCell>
                <TableCell>{venue.state}</TableCell>
                <TableCell>{venue.instructor}</TableCell>
                <TableCell>{venue.date}</TableCell>
              </TableRow>
            ))}
          </TableBody>
        </Table>
      </TableContainer>
      <Box display="flex" justifyContent="center" mt={3}>
        <Pagination
          count={totalPages}
          page={currentPage}
          onChange={(e, page) => setCurrentPage(page)}
        />
      </Box>
    </Container>
  );
};

export default Venue;
